import Link from "next/link";

const HeaderStyle = {
    display:"flex",
    flex:"1",
    justifyContent:"space-around",
  background: "#141414",
  height: "68px",
  alignItems: "center",
  justifyContent: "spaceAround",
  color:"#fff",
  padding: "0 4%",

};

const li = {
    float:"left",
    "margin-left":"20px",
}
const a ={
    color: "#fff",
}

const leftNavi = {
    border: "1px solid red",    

}
const rightNavi = {
    "margin-left":"auto"

}
const logo = {
    "margin-righ":"25px",
}

const pageNameList = [
  { id: 1, koName: "홈", enName: "/" },
  { id: 2, koName: "티비 프로그램", enName: "/TvProgram" },
  { id: 3, koName: "영화", enName: "/Movie" },
  { id: 4, koName: "최신 콘텐츠", enName: "/LatestContents" },
  { id: 5, koName: "티비 프로그램", enName: "/MyList" },
];

const pageName = pageNameList.map((pageNames) => (
  <li key={pageNames.id} style={li}>
    <Link href={pageNames.enName}>
      <a style={a}>{pageNames.koName}</a>
    </Link>
  </li>
));

const Header = () => (
    <div style={HeaderStyle}>
        <h1 style={logo}>logo</h1>        
        <ul style={leftNavi}>
            {pageName}
        </ul>
        <ul style={rightNavi}>
            {pageName}
        </ul>        
    </div>
);

export default Header;
